import React from 'react'
import { Link } from 'react-router-dom';

const Navbar = ({login}) => {
  return (
    <div className='navbar'>
        <h2>WorkOutBuddy-CodeFest-2k23</h2>
        <div>
            {
                login ?
                <Link to="/">Log Out</Link>:
                <Link to="/login">Log In</Link>
            }
        </div>
    </div>
  )
}

export default Navbar;
